script: |
  super -f text -I q8177.spq | sort > q8177.out

inputs:
  - name: q8177.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col1 NOT IN ( - 74, 90 + - col1, - col2 - + 49, + col0, - 99, - - col1 * - - 91 );
  - name: tab1

outputs:
  - name: q8177.out
    data: |
      51	14	96
      85	5	59
      91	47	68
